import { BrowserRouter, Link, Route, Switch } from 'react-router-dom'
import PeopleContainer from './PeopleContainer.js'
function App() {
return (
  <BrowserRouter>
  <Switch>
<Route path="/people">
<PeopleContainer/>
  </Route>
  <Link to="/people">People</Link>
  </Switch>
</BrowserRouter>
)
}
export default App;
